import { useEffect, useState } from "react"

function BoardAgent(){
    const [content, setContent] = useState("");

    useEffect(()=>{
        setContent(<div>Hello, agent!</div>)
    },[])


    return (
        <div className="container">
        <header className="jumbotron">
            <h3>{content}</h3>
        </header>
        </div>
    );
};
export default BoardAgent;
